import React from "react";
import Menu from "./Menu";
import Main from "./pages/Main";
import MapPage from "./pages/MapPage";
import Introduction from "./pages/Introduction";
import "./style.css";

function App() {
  return (
    <Router>
      <div className="page">
        <header>
          <Menu />
        </header>
        <main>
          <Switch>
            <Route path="/bemutatkozas">
              <Introduction />
            </Route>
            <Route path="/info">
              <MapPage />
            </Route>
            <Route path="/gyik">
              <BlogPost />
            </Route>
            <Route path="/map">
              <BlogList />
            </Route>
            {/* <Route path="/jelentkezes">
              <Jelentkezes />
            </Route> */}
            <Route path="/">
              <Main />
            </Route>
          </Switch>
        </main>
      </div>
    </Router>
  );
}

export default App;
